import React, { Component } from 'react';
import { Row, Col, Container, Form, Image, Button } from 'react-bootstrap';

// import { Row, Col, Container, Form, Image, Button } from 'react-bootstrap';
// import imgLogoSezonaPocetna from './imgPretragaPocetna/sezona-logo.png';

import './FooterPocetna.css';
export default class FooterPocetna extends Component {
	render() {
		return (
			<React.Fragment>
				<Container fluid>
					<Row>
						<footer className="footer-pocetna">
							<div className="footer-drzava-pocetna">
								<h3>Footer</h3>
							</div>
							<div className="footer-linkovi-pocetna">
								<h1>Footer</h1>
							</div>
						</footer>
					</Row>
				</Container>


                <Container>
                    <Row>
                        <Col>1 of 2</Col>
                        <Col>2 of 2</Col>
                    </Row>
                    <Row>
                        <Col>1 of 3</Col>
                        <Col>2 of 3</Col>
                        <Col>3 of 3</Col>
                    </Row>
                </Container>
			</React.Fragment>
		);
	}
}
